Vue.component('ui-cascader-city', {
    template: "<div><el-cascader ref='myCascader' :size='size' v-loading='loading' element-loading-spinner='el-icon-loading' filterable placeholder='请选择所在城市'" +
        ":style='{width:width}' :props='props' :value='selectValCitys'" +
        ":options='newList' v-on:change='handleChange' clearable></el-cascader ></div>",
    props: {
        value: {
            type: String,
            default: ''
        },
        clearable: {  //---删除
            type: Boolean,
            default: true
        },
        width: {
            type: String,
            default: '300px'
        },
        props: {  //------经过/点击
            type: Object,
            default: function () {
                return {
                    expandTrigger: 'hover'
                }
            }
        },
        filterable: {  //---搜索
            type: Boolean,
            default: true
        },
        size: {
            type: String,
            default: 'medium'
        },
        cityData: { //------外部导入的数据源
            type: Object | Array,
            default: function () {
                return dataCity;
            }
        }
    },
    data: function () {
        return {
            selectValCitys: [],  //-----被选中的数组/字符串/数字
            LevelTwoInit: 102,  //-----虚拟最后一级Id
            arrayList: [],  //------数据源转的二维
            newList: [], //----最新数据源，以防数据源未绑定到组件
            loading: true  //--------第一次加载时加载动画
        }
    },
    created: function () {
        this.Init();
    },
    methods: {
        ifLocalStorageitem: function () {  //-------读取缓存
            var _this = this
            if (JSON.parse(localStorage.getItem('citySource')) != undefined && JSON.parse(localStorage.getItem('cityArraySource')) != undefined) {
                setTimeout(function () {
                    _this.newList = JSON.parse(localStorage.getItem('citySource'))
                    _this.arrayList = JSON.parse(localStorage.getItem('cityArraySource'))
                    _this.selectArrayCity(_this.arrayList, _this.value)
                    _this.loading = false;
                    return true
                }, 10)
            }
            return false
        },
        handleChange: function (selectValCity) {  //-----------监听选中
            var thsAreaCode = ''
            if (selectValCity.length <= 0) { thsAreaCode = '' }
            else { thsAreaCode = this.$refs.myCascader.getCheckedNodes()[0].pathLabels.join(',') }
            this.$emit('input', thsAreaCode)
        },
        Init: function () {  //------初始化
            var _this = this
            //setTimeout(function () {

            //}, 0)
            _this.newList = _this.cityData
            _this.convertArray(_this.newList)
            localStorage.setItem('citySource', JSON.stringify(_this.newList))  //--------缓存到本地浏览器
            localStorage.setItem('cityArraySource', JSON.stringify(_this.arrayList));
        },
        convertArray: function (list) {//---------初始化二维数组并绑定默认值
            var _this = this
            var array = _this.transformation(list, [])  //------转数组
            _this.imensionalArray(array)  //------转二维数组
            _this.selectArrayCity(_this.arrayList, _this.value)
            this.loading = false
        },
        selectArrayCity: function (cityArrayList, SelectedCityValue) {  //--------初始化默认选中
            var _this = this
            try {
                if (SelectedCityValue == '' || SelectedCityValue == null) { return }
                SelectedCityValue = SelectedCityValue.split(',')
                cityArrayList.forEach(function (cityLevelOneVal, cityLevelOneIndex) {
                    if (cityLevelOneVal.length <= 0) { return }
                    if (cityLevelOneVal[0].val == SelectedCityValue[0]) {
                        _this.scalarArrayEquals(SelectedCityValue, cityLevelOneVal)
                    }
                })
            } catch (e) {
                throw e;
            }
        },
        scalarArrayEquals: function (SelectedCityValue, cityLevelOneVal) {  //----------根据label查找对应的value
            if (SelectedCityValue.length == cityLevelOneVal.length) {
                var newSelectedCityArrayVal = SelectedCityValue.map(function (v, vIndex) {
                    if (SelectedCityValue[vIndex] == cityLevelOneVal[vIndex].val) {
                        return cityLevelOneVal[vIndex].id
                    }
                    else {
                        return ''
                    }
                })
                if (newSelectedCityArrayVal.indexOf('') == -1) { this.selectValCitys = newSelectedCityArrayVal.map(function (item) { return parseInt(item) }) }
            }
        },
        transformation: function (departmentlist, oldDepartment) {  //-----数据源生成数组
            var _this = this;
            var newDepartment = [];
            departmentlist.forEach(function (item, inx) {
                newDepartment.push(JSON.parse(JSON.stringify(oldDepartment)))
                newDepartment[inx].push({
                    id: item.value.toString(),
                    val: item.label.toString()
                });
                if (Array.isArray(item.children)) {
                    newDepartment[inx] = _this.transformation(item.children, newDepartment[inx]);
                }
            })
            return newDepartment;
        },
        imensionalArray: function (departmentlist) {  //----转成二维数组
            var _this = this;
            departmentlist.forEach(function (item, inx) {
                if (Array.isArray(item) && Array.isArray(item[0])) {
                    _this.imensionalArray(item)
                } else {
                    _this.arrayList.push(item)
                }
            })
        }
    }
})